selector_to_html = {"a[href=\"#mirador-gh-set-pages\"]": "<figure class=\"align-default\" id=\"mirador-gh-set-pages\">\n<a class=\"reference internal image-reference\" href=\"../../_images/mirador-gh-set-pages.png\"><img alt=\"../../_images/mirador-gh-set-pages.png\" src=\"../../_images/mirador-gh-set-pages.png\" style=\"width: 600px;\"/></a>\n<figcaption>\n<p><span class=\"caption-number\">Fig. 28.41 </span><span class=\"caption-text\">Configure GH pages and then click <strong>Save</strong>.</span><a class=\"headerlink\" href=\"#mirador-gh-set-pages\" title=\"Link to this image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#iiif-manifest-download\"]": "<figure class=\"align-default\" id=\"iiif-manifest-download\">\n<a class=\"reference internal image-reference\" href=\"../../_images/iiif-manifest-download.png\"><img alt=\"../../_images/iiif-manifest-download.png\" src=\"../../_images/iiif-manifest-download.png\" style=\"width: 600px;\"/></a>\n<figcaption>\n<p><span class=\"caption-number\">Fig. 28.36 </span><span class=\"caption-text\">Right click on the file</span><a class=\"headerlink\" href=\"#iiif-manifest-download\" title=\"Link to this image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#iiif-manifests-folder\"]": "<figure class=\"align-default\" id=\"iiif-manifests-folder\">\n<a class=\"reference internal image-reference\" href=\"../../_images/iiif-manifests-folder.png\"><img alt=\"../../_images/iiif-manifests-folder.png\" src=\"../../_images/iiif-manifests-folder.png\" style=\"width: 600px;\"/></a>\n<figcaption>\n<p><span class=\"caption-number\">Fig. 28.35 </span><span class=\"caption-text\">Double click to open the folder</span><a class=\"headerlink\" href=\"#iiif-manifests-folder\" title=\"Link to this image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#mirador-gh-add-commit-files\"]": "<figure class=\"align-default\" id=\"mirador-gh-add-commit-files\">\n<a class=\"reference internal image-reference\" href=\"../../_images/mirador-gh-add-commit-files.png\"><img alt=\"../../_images/mirador-gh-add-commit-files.png\" src=\"../../_images/mirador-gh-add-commit-files.png\" style=\"width: 600px;\"/></a>\n<figcaption>\n<p><span class=\"caption-number\">Fig. 28.44 </span><span class=\"caption-text\">Click on <strong>Commit changes</strong>.</span><a class=\"headerlink\" href=\"#mirador-gh-add-commit-files\" title=\"Link to this image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#tools-and-standards\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Tools and standards<a class=\"headerlink\" href=\"#tools-and-standards\" title=\"Link to this heading\">#</a></h2>", "a[href=\"#mirador-gh-create-repo\"]": "<figure class=\"align-default\" id=\"mirador-gh-create-repo\">\n<a class=\"reference internal image-reference\" href=\"../../_images/mirador-gh-create-repo.png\"><img alt=\"../../_images/mirador-gh-create-repo.png\" src=\"../../_images/mirador-gh-create-repo.png\" style=\"width: 600px;\"/></a>\n<figcaption>\n<p><span class=\"caption-number\">Fig. 28.39 </span><span class=\"caption-text\">Enter your repository\u2019s name then click the button.</span><a class=\"headerlink\" href=\"#mirador-gh-create-repo\" title=\"Link to this image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#mirador-add-urls-file\"]": "<figure class=\"align-default\" id=\"mirador-add-urls-file\">\n<a class=\"reference internal image-reference\" href=\"../../_images/mirador-add-urls-file.png\"><img alt=\"../../_images/mirador-add-urls-file.png\" src=\"../../_images/mirador-add-urls-file.png\" style=\"width: 600px;\"/></a>\n<figcaption>\n<p><span class=\"caption-number\">Fig. 28.46 </span><span class=\"caption-text\">Click on the pencil icon.</span><a class=\"headerlink\" href=\"#mirador-add-urls-file\" title=\"Link to this image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#using-ardc-binder\"]": "<h4 class=\"tippy-header\" style=\"margin-top: 0;\">Using ARDC Binder<a class=\"headerlink\" href=\"#using-ardc-binder\" title=\"Link to this heading\">#</a></h4><p>To use the ARDC Binder service, click on the ARDC Binder tab under the notebook preview. You should see a big, blue <strong>Run live on ARDC Binder</strong> button. Click on the button to launch the Binder service.</p><p>If this is the first time you\u2019ve used the ARDC Binder service you\u2019ll be asked to login using the Australian Access Federation (AAF).</p>", "a[href=\"#create-a-mirador-workspace-using-github-pages\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Create a Mirador workspace using GitHub Pages<a class=\"headerlink\" href=\"#create-a-mirador-workspace-using-github-pages\" title=\"Link to this heading\">#</a></h2><p><a class=\"reference external\" href=\"https://projectmirador.org/\">Mirador</a> provides a workspace in which you can load multiple IIIF manifests to compare images and documents. This tutorial uses a GitHub template to create a customised Mirador installation running on GitHub Pages.</p><p>If you don\u2019t have one already, you\u2019ll need <a class=\"reference external\" href=\"https://docs.github.com/en/get-started/start-your-journey/creating-an-account-on-github\">to create a GitHub user account</a> \u2013 the standard free, personal account is fine.</p>", "a[href=\"#mirador-basic-demo\"]": "<figure class=\"align-default\" id=\"mirador-basic-demo\">\n<a class=\"reference internal image-reference\" href=\"../../_images/mirador-basic-demo.png\"><img alt=\"../../_images/mirador-basic-demo.png\" src=\"../../_images/mirador-basic-demo.png\" style=\"width: 600px;\"/></a>\n<figcaption>\n<p><span class=\"caption-number\">Fig. 28.48 </span><span class=\"caption-text\">The Mirador workspace</span><a class=\"headerlink\" href=\"#mirador-basic-demo\" title=\"Link to this image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#adding-remote-manifests-optional\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\">Adding remote manifests (optional)<a class=\"headerlink\" href=\"#adding-remote-manifests-optional\" title=\"Link to this heading\">#</a></h3><p>Perhaps there are collections in other cultural institutions that you\u2019d like to compare with the ones you\u2019ve harvested from Trove. If those collections are displayed using IIIF, you can add links to the manifests from your Mirador installation.</p><p>From your repository\u2019s home page click on the <code class=\"docutils literal notranslate\"><span class=\"pre\">manifest_urls.txt</span></code> file to open it.</p>", "a[href=\"#collection-cite-identifier\"]": "<figure class=\"align-default\" id=\"collection-cite-identifier\">\n<a class=\"reference internal image-reference\" href=\"../../_images/collection-cite-identifier.png\"><img alt=\"../../_images/collection-cite-identifier.png\" src=\"../../_images/collection-cite-identifier.png\" style=\"width: 600px;\"/></a>\n<figcaption>\n<p><span class=\"caption-number\">Fig. 28.27 </span><span class=\"caption-text\">Clicking on the <strong>Cite</strong> button reveals the collection\u2019s identifier.</span><a class=\"headerlink\" href=\"#collection-cite-identifier\" title=\"Link to this image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#finding-collection-pages\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\">Finding collection pages<a class=\"headerlink\" href=\"#finding-collection-pages\" title=\"Link to this heading\">#</a></h3><p>Trove groups digitised resources into collections of different shapes and sizes. Here are some examples:</p>", "a[href=\"#running-the-notebook\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\">Running the notebook<a class=\"headerlink\" href=\"#running-the-notebook\" title=\"Link to this heading\">#</a></h3><p>Go to <a class=\"reference external\" href=\"https://glam-workbench.net/trove-images/save-image-collection-iiif/\">Save a collection of digitised images as an IIIF manifest</a> in the Trove images section of the GLAM Workbench.</p><p>This notebook, like all GLAM Workbench notebooks, needs to be run in a customised computing environment. The easiest way to do this is through BinderHub. BinderHub is a cloud-based service that gets a notebook up and running by reading its requirements from a code repository, and creating an environment with the necessary software. The GLAM Workbench is integrated with two BinderHub services:</p>", "a[href=\"../../understanding-search/finding-digitised-content.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">11. </span>Finding NLA digitised content you can download<a class=\"headerlink\" href=\"#finding-nla-digitised-content-you-can-download\" title=\"Link to this heading\">#</a></h1><p>Trove provides a platform for the delivery of digitised content from the National Library of Australia and its partners. This digitised content is easy to find in the <em>Newspapers &amp; gazettes</em> and <em>Magazines &amp; newsletters</em> categories \u2013 they\u2019re full of it! But it\u2019s not so easy to find digitised content in other categories where it\u2019s mixed with works aggregated from a range of different sources.</p><p>There are a few different approaches to finding digitised content, but they all have potential problems. While I highlight what I think is the most reliable option, it\u2019s really a matter of working out what will best meet your research needs.</p>", "a[href=\"#mirador-add-urls-edit\"]": "<figure class=\"align-default\" id=\"mirador-add-urls-edit\">\n<a class=\"reference internal image-reference\" href=\"../../_images/mirador-add-urls-edit.png\"><img alt=\"../../_images/mirador-add-urls-edit.png\" src=\"../../_images/mirador-add-urls-edit.png\" style=\"width: 600px;\"/></a>\n<figcaption>\n<p><span class=\"caption-number\">Fig. 28.47 </span><span class=\"caption-text\">Add manifest urls.</span><a class=\"headerlink\" href=\"#mirador-add-urls-edit\" title=\"Link to this image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#mirador-example-manifests\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\">Example manifests<a class=\"headerlink\" href=\"#example-manifests\" title=\"Link to this heading\">#</a></h3><p>As an example, I\u2019ve saved the Federation sections of the Barton and Deakin papers as manifests, and uploaded them to GitHub.  You can see <a class=\"reference internal\" href=\"#mirador-example-workspace\"><span class=\"std std-ref\">what they look like in Mirador</span></a> below.</p>", "a[href=\"#what-is-iiif\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\">What is IIIF?<a class=\"headerlink\" href=\"#what-is-iiif\" title=\"Link to this heading\">#</a></h3><p>The <a class=\"reference external\" href=\"https://iiif.io/\">International Image Interoperability Framework</a>, more conveniently known as IIIF, develops open standards for sharing digital objects, such as images. IIIF platforms and standards are used by GLAM organisations around the world to deliver their image collections online.</p><p>Once you have standards for sharing image metadata, people can build tools that work across collections. For example, <a class=\"reference external\" href=\"https://universalviewer.io/\">Universal Viewer</a> and <a class=\"reference external\" href=\"https://projectmirador.org/\">Mirador</a> are both richly featured, open source, community developed image viewing platforms.</p>", "a[href=\"#getting-the-collections-nla-obj-identifier\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\">Getting the collection\u2019s <code class=\"docutils literal notranslate\"><span class=\"pre\">nla.obj</span></code> identifier<a class=\"headerlink\" href=\"#getting-the-collections-nla-obj-identifier\" title=\"Link to this heading\">#</a></h3><p>Once you\u2019ve found the collection\u2019s landing page you need to copy its <code class=\"docutils literal notranslate\"><span class=\"pre\">nla.obj</span></code> identifier. You can find the identifier in a couple of places.</p><p>If the page has a <strong>Cite</strong> button or tab, click on it to reveal more information about the collection, including the identifier.</p>", "a[href=\"#collection-url-identifier\"]": "<figure class=\"align-default\" id=\"collection-url-identifier\">\n<a class=\"reference internal image-reference\" href=\"../../_images/collection-url-identifier.png\"><img alt=\"../../_images/collection-url-identifier.png\" src=\"../../_images/collection-url-identifier.png\" style=\"width: 600px;\"/></a>\n<figcaption>\n<p><span class=\"caption-number\">Fig. 28.28 </span><span class=\"caption-text\">Your browser\u2019s location bar includes the identifier of the current page.</span><a class=\"headerlink\" href=\"#collection-url-identifier\" title=\"Link to this image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#using-mirador\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\">Using Mirador<a class=\"headerlink\" href=\"#using-mirador\" title=\"Link to this heading\">#</a></h3><p>When you open your new Mirador workspace there\u2019ll be a window for each local or remote manifest. You can move windows by clicking and dragging the title bars, and resize them by grabbing their corners. Zoom images using the mouse wheel, and move between images by clicking on the arrows at the bottom of the active window.</p><p>Clicking on a window\u2019s left-hand menu icon opens the navigation sidebar. Click on the index icon to open up the table of contents. For Trove collections, this table of contents will reflect the hierarchical structure of the original collection. You can use the table of contents to explore the collection. Alternatively, there\u2019s a flat list of items, and a list of thumbnails.</p>", "a[href=\"#mirador-add-urls\"]": "<figure class=\"align-default\" id=\"mirador-add-urls\">\n<a class=\"reference internal image-reference\" href=\"../../_images/mirador-add-urls.png\"><img alt=\"../../_images/mirador-add-urls.png\" src=\"../../_images/mirador-add-urls.png\" style=\"width: 600px;\"/></a>\n<figcaption>\n<p><span class=\"caption-number\">Fig. 28.45 </span><span class=\"caption-text\">Open the <code class=\"docutils literal notranslate\"><span class=\"pre\">manifest_urls.txt</span></code> file.</span><a class=\"headerlink\" href=\"#mirador-add-urls\" title=\"Link to this image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#id1\"]": "<figure class=\"align-default\" id=\"id1\">\n<a class=\"reference internal image-reference\" href=\"../../_images/ardc-binder-aaf-login.png\"><img alt=\"../../_images/ardc-binder-aaf-login.png\" src=\"../../_images/ardc-binder-aaf-login.png\" style=\"width: 600px;\"/></a>\n<figcaption>\n<p><span class=\"caption-number\">Fig. 28.30 </span><span class=\"caption-text\">ARDC Binder will ask you to log in using AAF</span><a class=\"headerlink\" href=\"#id1\" title=\"Link to this image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#gw-iiif-nb\"]": "<figure class=\"align-default\" id=\"gw-iiif-nb\">\n<a class=\"reference internal image-reference\" href=\"../../_images/gw-iiif-nb.png\"><img alt=\"../../_images/gw-iiif-nb.png\" src=\"../../_images/gw-iiif-nb.png\" style=\"width: 600px;\"/></a>\n<figcaption>\n<p><span class=\"caption-number\">Fig. 28.29 </span><span class=\"caption-text\">The GLAM Workbench provides a number of ways you can run the notebook.</span><a class=\"headerlink\" href=\"#gw-iiif-nb\" title=\"Link to this image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#series-and-sub-collections\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\">Series and sub-collections<a class=\"headerlink\" href=\"#series-and-sub-collections\" title=\"Link to this heading\">#</a></h3><p>Manuscript collections are often arranged hierarchically, with individual items grouped into series and sub-series. Trove displays these hierarchies in the form of \u2018finding aids\u2019 that present a one page overview of the complete collection. But under the hood, the levels within these hierarchies are actually created using Trove\u2019s digitised collection viewer. This means we can selectively harvest <em>parts</em> of manuscript collections.</p><p>For example, here\u2019s part of the finding aid for the <a class=\"reference external\" href=\"https://nla.gov.au/nla.obj-225220821/findingaid\">Papers of Alfred Deakin</a>, displaying \u2018Series 11. Federation delegate, 1884-1944\u2019.</p>", "a[href=\"#iiif-nb-jupyterlab\"]": "<figure class=\"align-default\" id=\"iiif-nb-jupyterlab\">\n<a class=\"reference internal image-reference\" href=\"../../_images/iiif-nb-jupyterlab.png\"><img alt=\"../../_images/iiif-nb-jupyterlab.png\" src=\"../../_images/iiif-nb-jupyterlab.png\" style=\"width: 600px;\"/></a>\n<figcaption>\n<p><span class=\"caption-number\">Fig. 28.33 </span><span class=\"caption-text\">The notebook running in Jupyter Lab.</span><a class=\"headerlink\" href=\"#iiif-nb-jupyterlab\" title=\"Link to this image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#mybinder-tab\"]": "<figure class=\"align-default\" id=\"mybinder-tab\">\n<a class=\"reference internal image-reference\" href=\"../../_images/mybinder-tab.png\"><img alt=\"../../_images/mybinder-tab.png\" src=\"../../_images/mybinder-tab.png\" style=\"width: 600px;\"/></a>\n<figcaption>\n<p><span class=\"caption-number\">Fig. 28.32 </span><span class=\"caption-text\">Click on the MyBinder tab.</span><a class=\"headerlink\" href=\"#mybinder-tab\" title=\"Link to this image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#example-workspace\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Example workspace<a class=\"headerlink\" href=\"#example-workspace\" title=\"Link to this heading\">#</a></h2><p>Here\u2019s a live Mirador workspace created using the GitHub template. I\u2019ve uploaded the <a class=\"reference internal\" href=\"#mirador-example-manifests\"><span class=\"std std-ref\">manifests from the Barton and Deakin papers</span></a> to make it possible to compare documents relating to Federation from the two collections. Try moving the windows and exploring the documents.</p>", "a[href=\"#create-manifest-deakin\"]": "<figure class=\"align-default\" id=\"create-manifest-deakin\">\n<a class=\"reference internal image-reference\" href=\"../../_images/create-manifest-deakin.png\"><img alt=\"../../_images/create-manifest-deakin.png\" src=\"../../_images/create-manifest-deakin.png\" style=\"width: 600px;\"/></a>\n<figcaption>\n<p><span class=\"caption-number\">Fig. 28.34 </span><span class=\"caption-text\">Enter the <code class=\"docutils literal notranslate\"><span class=\"pre\">nla.obj</span></code> identifier as shown.</span><a class=\"headerlink\" href=\"#create-manifest-deakin\" title=\"Link to this image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#deakin-papers-series\"]": "<figure class=\"align-default\" id=\"deakin-papers-series\">\n<a class=\"reference internal image-reference\" href=\"../../_images/deakin-papers-series.png\"><img alt=\"../../_images/deakin-papers-series.png\" src=\"../../_images/deakin-papers-series.png\" style=\"width: 600px;\"/></a>\n<figcaption>\n<p><span class=\"caption-number\">Fig. 28.26 </span><span class=\"caption-text\">\u2018Series 11, Federation Delegate\u2019 displayed in Trove\u2019s digitised collection viewer.</span><a class=\"headerlink\" href=\"#deakin-papers-series\" title=\"Link to this image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#mirador-gh-action-complete\"]": "<figure class=\"align-default\" id=\"mirador-gh-action-complete\">\n<a class=\"reference internal image-reference\" href=\"../../_images/mirador-gh-action-complete.png\"><img alt=\"../../_images/mirador-gh-action-complete.png\" src=\"../../_images/mirador-gh-action-complete.png\" style=\"width: 600px;\"/></a>\n<figcaption>\n<p><span class=\"caption-number\">Fig. 28.40 </span><span class=\"caption-text\">Wait for the workflow action to complete.</span><a class=\"headerlink\" href=\"#mirador-gh-action-complete\" title=\"Link to this image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#mirador-gh-use-template\"]": "<figure class=\"align-default\" id=\"mirador-gh-use-template\">\n<a class=\"reference internal image-reference\" href=\"../../_images/mirador-gh-use-template.png\"><img alt=\"../../_images/mirador-gh-use-template.png\" src=\"../../_images/mirador-gh-use-template.png\" style=\"width: 400px;\"/></a>\n<figcaption>\n<p><span class=\"caption-number\">Fig. 28.38 </span><span class=\"caption-text\">Click on the <strong>Use this template</strong> button.</span><a class=\"headerlink\" href=\"#mirador-gh-use-template\" title=\"Link to this image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#comparing-manuscript-collections-in-mirador\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Comparing manuscript collections in Mirador<a class=\"headerlink\" href=\"#comparing-manuscript-collections-in-mirador\" title=\"Link to this heading\">#</a></h1><p>You want to compare the contents of two digitised manuscript collections and examine individual documents side-by-side. The <a class=\"reference external\" href=\"https://projectmirador.org/\">Mirador viewer</a> can be configured as a flexible, research workspace that displays multiple images from different sources, but how do you get manuscript collections from Trove to Mirador?</p><p><img alt=\"Mirador example workspace\" src=\"../../_images/mirador-demo.png\"/></p>", "a[href=\"#collection-breadcrumbs\"]": "<figure class=\"align-default\" id=\"collection-breadcrumbs\">\n<a class=\"reference internal image-reference\" href=\"../../_images/collection-breadcrumbs.png\"><img alt=\"../../_images/collection-breadcrumbs.png\" src=\"../../_images/collection-breadcrumbs.png\" style=\"width: 600px;\"/></a>\n<figcaption>\n<p><span class=\"caption-number\">Fig. 28.22 </span><span class=\"caption-text\">An photo within the B.A.N.Z. Antarctic Research Expedition collection (<a class=\"reference external\" href=\"https://nla.gov.au/nla.obj-141171021\">https://nla.gov.au/nla.obj-141171021</a>) \u2013 clicking on the breadcrumb link will take you up to the collection landing page.</span><a class=\"headerlink\" href=\"#collection-breadcrumbs\" title=\"Link to this image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#deakin-papers-findingaid\"]": "<figure class=\"align-default\" id=\"deakin-papers-findingaid\">\n<a class=\"reference internal image-reference\" href=\"../../_images/deakin-papers-findingaid.png\"><img alt=\"../../_images/deakin-papers-findingaid.png\" src=\"../../_images/deakin-papers-findingaid.png\" style=\"width: 600px;\"/></a>\n<figcaption>\n<p><span class=\"caption-number\">Fig. 28.23 </span><span class=\"caption-text\">Section of the finding aid listing the Papers of Alfred Deakin.</span><a class=\"headerlink\" href=\"#deakin-papers-findingaid\" title=\"Link to this image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#loading-your-manifests\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\">Loading your manifests<a class=\"headerlink\" href=\"#loading-your-manifests\" title=\"Link to this heading\">#</a></h3><p>Once your Mirador site is ready, you can load your IIIF manifests.</p><p>From your repository\u2019s home page click on the <code class=\"docutils literal notranslate\"><span class=\"pre\">manifests</span></code> folder to open it. Click on the <strong>Add files</strong> button, then select \u2018Upload files\u2019.</p>", "a[href=\"#deakin-papers-item\"]": "<figure class=\"align-default\" id=\"deakin-papers-item\">\n<a class=\"reference internal image-reference\" href=\"../../_images/deakin-papers-item.png\"><img alt=\"../../_images/deakin-papers-item.png\" src=\"../../_images/deakin-papers-item.png\" style=\"width: 600px;\"/></a>\n<figcaption>\n<p><span class=\"caption-number\">Fig. 28.25 </span><span class=\"caption-text\">The item\u2019s breadcrumb trail takes you back up the collection hierarchy.</span><a class=\"headerlink\" href=\"#deakin-papers-item\" title=\"Link to this image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#mirador-gh-repo\"]": "<figure class=\"align-default\" id=\"mirador-gh-repo\">\n<a class=\"reference internal image-reference\" href=\"../../_images/mirador-gh-repo.png\"><img alt=\"../../_images/mirador-gh-repo.png\" src=\"../../_images/mirador-gh-repo.png\" style=\"width: 600px;\"/></a>\n<figcaption>\n<p><span class=\"caption-number\">Fig. 28.37 </span><span class=\"caption-text\">The mirador-ghpages template repository.</span><a class=\"headerlink\" href=\"#mirador-gh-repo\" title=\"Link to this image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#identifying-a-collection-in-trove\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Identifying a collection in Trove<a class=\"headerlink\" href=\"#identifying-a-collection-in-trove\" title=\"Link to this heading\">#</a></h2><p>The first thing you need is a collection to harvest! More specifically, you need to find a collection\u2019s landing page in Trove\u2019s digitised collection viewer. Once you\u2019ve found the collection page, you can copy its <code class=\"docutils literal notranslate\"><span class=\"pre\">nla.obj</span></code> identifier.</p>", "a[href=\"#using-mybinder\"]": "<h4 class=\"tippy-header\" style=\"margin-top: 0;\">Using MyBinder<a class=\"headerlink\" href=\"#using-mybinder\" title=\"Link to this heading\">#</a></h4><p>To use the MyBinder service, click on the MyBinder tab under the notebook preview. You should see a big, blue <strong>Run live on MyBinder</strong> button. Click on the button to launch the Binder service. No login is required, so MyBinder immediately starts building a customised computing environment. This can take a while, but eventually the notebook should load in the Jupyter Lab interface.</p>", "a[href=\"#mirador-example-workspace\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Example workspace<a class=\"headerlink\" href=\"#example-workspace\" title=\"Link to this heading\">#</a></h2><p>Here\u2019s a live Mirador workspace created using the GitHub template. I\u2019ve uploaded the <a class=\"reference internal\" href=\"#mirador-example-manifests\"><span class=\"std std-ref\">manifests from the Barton and Deakin papers</span></a> to make it possible to compare documents relating to Federation from the two collections. Try moving the windows and exploring the documents.</p>", "a[href=\"#mirador-add-window\"]": "<figure class=\"align-default\" id=\"mirador-add-window\">\n<a class=\"reference internal image-reference\" href=\"../../_images/mirador-add-window.png\"><img alt=\"../../_images/mirador-add-window.png\" src=\"../../_images/mirador-add-window.png\" style=\"width: 600px;\"/></a>\n<figcaption>\n<p><span class=\"caption-number\">Fig. 28.50 </span><span class=\"caption-text\">Click on the blue \u2018+\u2019 icon then select a collection.</span><a class=\"headerlink\" href=\"#mirador-add-window\" title=\"Link to this image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#example-manifests\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\">Example manifests<a class=\"headerlink\" href=\"#example-manifests\" title=\"Link to this heading\">#</a></h3><p>As an example, I\u2019ve saved the Federation sections of the Barton and Deakin papers as manifests, and uploaded them to GitHub.  You can see <a class=\"reference internal\" href=\"#mirador-example-workspace\"><span class=\"std std-ref\">what they look like in Mirador</span></a> below.</p>", "a[href=\"#deakin-papers-view-images\"]": "<figure class=\"align-default\" id=\"deakin-papers-view-images\">\n<a class=\"reference internal image-reference\" href=\"../../_images/deakin-papers-view-images.png\"><img alt=\"../../_images/deakin-papers-view-images.png\" src=\"../../_images/deakin-papers-view-images.png\" style=\"width: 600px;\"/></a>\n<figcaption>\n<p><span class=\"caption-number\">Fig. 28.24 </span><span class=\"caption-text\">Click on a thumbnail to view the item.</span><a class=\"headerlink\" href=\"#deakin-papers-view-images\" title=\"Link to this image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#aaf-institutions-select\"]": "<figure class=\"align-default\" id=\"aaf-institutions-select\">\n<a class=\"reference internal image-reference\" href=\"../../_images/aaf-institutions-select.png\"><img alt=\"../../_images/aaf-institutions-select.png\" src=\"../../_images/aaf-institutions-select.png\" style=\"width: 300px;\"/></a>\n<figcaption>\n<p><span class=\"caption-number\">Fig. 28.31 </span><span class=\"caption-text\">Select your institution from the AAF list</span><a class=\"headerlink\" href=\"#aaf-institutions-select\" title=\"Link to this image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#creating-and-configuring-your-own-mirador-installation\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\">Creating and configuring your own Mirador installation<a class=\"headerlink\" href=\"#creating-and-configuring-your-own-mirador-installation\" title=\"Link to this heading\">#</a></h3><p>Head to the <a class=\"reference external\" href=\"https://github.com/wragge/mirador-ghpages\">mirador-ghpages</a> repository.</p>", "a[href=\"#collection-album-landing\"]": "<figure class=\"align-default\" id=\"collection-album-landing\">\n<a class=\"reference internal image-reference\" href=\"../../_images/collection-album-landing.png\"><img alt=\"../../_images/collection-album-landing.png\" src=\"../../_images/collection-album-landing.png\" style=\"width: 600px;\"/></a>\n<figcaption>\n<p><span class=\"caption-number\">Fig. 28.21 </span><span class=\"caption-text\">The landing page for the B.A.N.Z. Antarctic Research Expedition photographs (<a class=\"reference external\" href=\"https://nla.gov.au/nla.obj-141170265\">https://nla.gov.au/nla.obj-141170265</a>)</span><a class=\"headerlink\" href=\"#collection-album-landing\" title=\"Link to this image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#mirador-window-index\"]": "<figure class=\"align-default\" id=\"mirador-window-index\">\n<a class=\"reference internal image-reference\" href=\"../../_images/mirador-window-index.png\"><img alt=\"../../_images/mirador-window-index.png\" src=\"../../_images/mirador-window-index.png\" style=\"width: 400px;\"/></a>\n<figcaption>\n<p><span class=\"caption-number\">Fig. 28.49 </span><span class=\"caption-text\">Open the navigation sidebar to browse the table of contents.</span><a class=\"headerlink\" href=\"#mirador-window-index\" title=\"Link to this image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#mirador-image-tools\"]": "<figure class=\"align-default\" id=\"mirador-image-tools\">\n<a class=\"reference internal image-reference\" href=\"../../_images/mirador-image-tools.png\"><img alt=\"../../_images/mirador-image-tools.png\" src=\"../../_images/mirador-image-tools.png\" style=\"width: 400px;\"/></a>\n<figcaption>\n<p><span class=\"caption-number\">Fig. 28.51 </span><span class=\"caption-text\">Open the image tools.</span><a class=\"headerlink\" href=\"#mirador-image-tools\" title=\"Link to this image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#using-the-notebook-in-jupyter-lab\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\">Using the notebook in Jupyter Lab<a class=\"headerlink\" href=\"#using-the-notebook-in-jupyter-lab\" title=\"Link to this heading\">#</a></h3><p>No matter what service you use to run the notebook, the result will be the same \u2013 the notebook will open in the Jupyter Lab interface.</p>", "a[href=\"#mirador-gh-deployments\"]": "<figure class=\"align-default\" id=\"mirador-gh-deployments\">\n<a class=\"reference internal image-reference\" href=\"../../_images/mirador-gh-deployments.png\"><img alt=\"../../_images/mirador-gh-deployments.png\" src=\"../../_images/mirador-gh-deployments.png\" style=\"width: 600px;\"/></a>\n<figcaption>\n<p><span class=\"caption-number\">Fig. 28.42 </span><span class=\"caption-text\">The url of your new Mirador site will be listed under \u2018Deployments\u2019.</span><a class=\"headerlink\" href=\"#mirador-gh-deployments\" title=\"Link to this image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#saving-a-trove-collection-as-an-iiif-manifest\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Saving a Trove collection as an IIIF manifest<a class=\"headerlink\" href=\"#saving-a-trove-collection-as-an-iiif-manifest\" title=\"Link to this heading\">#</a></h2><p>The first step in importing Trove data into Mirador is to save the data in a format that Mirador understands. You can save a Trove collection as an IIIF manifest using <a class=\"reference external\" href=\"https://glam-workbench.net/trove-images/save-image-collection-iiif/\">this noteboook</a> in the GLAM Workbench.</p>", "a[href=\"#mirador-gh-upload\"]": "<figure class=\"align-default\" id=\"mirador-gh-upload\">\n<a class=\"reference internal image-reference\" href=\"../../_images/mirador-gh-upload.png\"><img alt=\"../../_images/mirador-gh-upload.png\" src=\"../../_images/mirador-gh-upload.png\" style=\"width: 600px;\"/></a>\n<figcaption>\n<p><span class=\"caption-number\">Fig. 28.43 </span><span class=\"caption-text\">Click on <strong>Add files</strong> in the <code class=\"docutils literal notranslate\"><span class=\"pre\">manifests</span></code> directory.</span><a class=\"headerlink\" href=\"#mirador-gh-upload\" title=\"Link to this image\">#</a></p>\n</figcaption>\n</figure>"}
skip_classes = ["headerlink", "sd-stretched-link", "sd-rounded-pill"]

window.onload = function () {
    for (const [select, tip_html] of Object.entries(selector_to_html)) {
        const links = document.querySelectorAll(`article.bd-article ${select}`);
        for (const link of links) {
            if (skip_classes.some(c => link.classList.contains(c))) {
                continue;
            }

            tippy(link, {
                content: tip_html,
                allowHTML: true,
                arrow: true,
                placement: 'auto-start', maxWidth: 500, interactive: false,

            });
        };
    };
    console.log("tippy tips loaded!");
};
